import React from 'react';
import Sales from "../components/Sales";
import Invoices from "../components/Invoices";
import Estimates from "../components/Estimates";
import {BrowserRouter as Router, Link, Route} from "react-router-dom";

const dataRoute = [
    { path: '/sales',
        main: () =>  <Sales/>
    },
    { path: '/invoices',
        main: () => <Invoices/>
    },
    {
        path: '/estimates',
        main: () => <Estimates/>
    }
]

export const QBData = (props) => (
            <>
            <div style={{marginLeft: '170px',marginTop: '0px',fontSize: '2rem', fontWeight: 'bold'}}>View your QuickBooks Data</div>
            <Router>
            <div style={{marginLeft: '150px', marginTop:'10px', backgroundColor: 'red', width:'280px'}}>
                    <ul style={{listStyleType: 'none', display:'inline'}}>
                        <Link to="/sales" style={{marginRight: '10px', color:'black', fontSize:'1.2em'}}>Sales</Link>
                        <Link to="/invoices" style={{marginRight: '10px', color:'black', fontSize:'1.2em'}}>Invoices</Link>
                        <Link to="/estimates" style={{color:'black', fontSize:'1.2em'}}>Estimates</Link>
                    </ul>
                <div>
                    {dataRoute.map((route) => (
                        <Route
                            key={route.path}
                            path={route.path}
                            exact={route.exact}
                            component={route.main}
                        />
                    ))}
                </div>
            </div>
            </Router>

            </>
)
